import React from "react";


const Slider = () => {
  return (
    <div className="slider_div">

      <button>系統說明</button>
      <button>系統教學</button>
      <button>最新消息</button>
      <button>我要訂餐</button>
      <button>常見問題</button>
      <button>意見填寫</button>

    </div>
  );
};

export default Slider;
